      const fetchItem = await fetch(`https://fortnite-api.theapinetwork.com/item/get?id=${match.params.id}`);
      const item = await fetchItem.json();

      console.log(item);

  }
  return (
    <div>
      <h1>item</h1>
    </div>
  );
}
export default ItemDetail;
